#{

# build the data array

data = [
  [@{binmax6},@{trig6},@{binavg6},@{lbin6}],
  [@{binmax5},@{trig5},@{binavg5},@{lbin5}],
  [@{binmax4},@{trig4},@{binavg4},@{lbin4}],
  [@{binmax3},@{trig3},@{binavg3},@{lbin3}],
  [@{binmax2},@{trig2},@{binavg2},@{lbin2}],
  [@{binmax1},@{trig1},@{binavg1},@{lbin1}],
  [@{binmax0},@{trig0},@{binavg0},@{lbin0}]
];

# extract channels and convert to relative y-axis coordinates
# assuming the range is 0-255

maxbin = 100 - flatten(data[0:end,0]) / 255 * 100;
trigbin = 100 - flatten(data[0:end,1]) / 255 * 100;
avgbin = 100 - flatten(data[0:end,2]) / 255 * 100;
lastbin = 100 - flatten(data[0:end,3]) / 255 * 100;


# build the x-axis relative coordinates array

length = size(maxbin)[0]
xaxis = (0:length) / (length-1) * 100;


# convert coords to svg path string
svgCoords(color) = map(color, f(c,i)=print("L$0%x $1%y", [xaxis[i], c]));

# svg path first command must be "M", not "L" 
svgString(color) = concat("M", unpack(svgCoords(color))[1:end]);

}


<path stroke="red" d="#{svgString(maxbin)}" />
<path stroke="lime" d="#{svgString(trigbin)}" />
<path stroke="magenta" d="#{svgString(lastbin)}" />
<path stroke="gray" d="#{svgString(avgbin)}" />
